import { useEffect } from "react"
import { useDispatch } from "react-redux"
import { fetchOrder } from "../store/actions/shop-action"

const Order = () => {
  const authUser = useSelector(state => state.auth)
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(fetchOrder(authUser.customerId))
  }, [dispatch])

  return (
    <>
      <div class="ui middle aligned divided list">
        <div class="item">
          <div class="right floated content">
            <div class="ui button">View Order</div>
          </div>
          <img class="ui avatar image" src="/images/avatar2/small/lena.png" />
          <div class="content">Lena</div>
        </div>
      </div>
    </>
  )
}

export default Order
